import React from 'react';
import './zkHealthCare.css';  // Import the corresponding CSS

function ZkHealthCare() {
  return (
    <div className="zk-healthcare-container">
      <div className="zk-healthcare-image">
        <img src="/images/zk-healthcare.jpg" alt="ZK Healthcare" />
      </div>
      <div className="zk-healthcare-description">
        <h2>ZK Healthcare</h2>
        <p>ZK Healthcare is dedicated to providing top-tier medical products and services that cater to the evolving needs of the healthcare industry. Our focus on innovation and quality ensures that we offer solutions that positively impact patient care.</p>
      </div>
    </div>
  );
}

export default ZkHealthCare;
